import styled from "styled-components";
import { useModal } from "../hooks/useModal";

interface modalProps {
  isModalOpen: boolean;
  /* close(): void;
  label: string;
  additional?: any; */
}

const Wrapper = styled.div`
  width: 330px;
  height: 180px;
  border: 1px solid black;
  border-radius: 20px;
  z-index: 1000;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

const Modal = ({ isModalOpen }: modalProps) => {
  return (
  <div>
    {isModalOpen && <Wrapper></Wrapper>}
  </div>
  );
};

export default Modal;
